      .container {
        overflow: hidden;
        max-width: 700px;
        margin: auto;
        padding-top: 80px;
        border-radius: 8px;
      }

      input[type="text"] {
        width: 55%; /* Augmentez la largeur si n√©cessaire */
        margin: auto; /* Ajoute une marge en haut et en bas, et centre horizontalement */
        display: block; /* Assure que l'√©l√©ment prend toute la largeur disponible */
        outline: none;
        border: 2px solid  rgba(245, 245, 245, 0.3); /* Ajoute une bordure visible */
        border-radius: 10px;
        background-color: rgba(29, 29, 42, 0.7);
        transition: border-color 0.3s, background-color 0.3s; /* Ajoute une transition pour le changement de couleur de la bordure et du fond */
        color: #ffffff; /* Couleur du texte √† l'int√©rieur des champs */
      }

      input[type="text"]:focus {
        outline: none;
        border: 2px solid #5588ff; /* Remplacez '#5588ff' par la couleur exacte que vous utilisez sur votre page */
        border-radius: 10px;
        background-color: rgba(52, 53, 65, 0.7);
      }

      input[type="text"]:hover {
        outline: none;
        border: 2px solid #5588ff; /* Remplacez '#5588ff' par la couleur exacte que vous utilisez sur votre page */
        border-radius: 10px;
        background-color: rgba(52, 53, 65, 1);
      }

      ::placeholder {
        /* color: #5588ff; */
        /* color: #97b6ff;  */
        color: #a3a3a3a2;
      }

      #neutral_search {
        font-size: 14px;
        color: #ffffff;
        opacity: 1;
        font-family: "Ubuntu";
        padding: 6px 10px;

      }

      #strict_search , #exclude_search, #site_search, #format_search, #time_search {
        font-size: 14px;
        color: #ffffff;
        opacity: 1;
        font-family: "Ubuntu";
        padding: 6px 10px;
        margin-top: 5px;
        margin-bottom: 5px;
      }

      .accordion-header {
        padding-top: 10px;
        font-size: 20px;
        cursor: pointer;
        color:#ffffff;
        display: flex;
        align-items: center;
        transition: background-color 0.3s;
        justify-content: center;
        font-family: "Ubuntu";
      }

      .accordion-header:hover {
        color:#5588ff;
      }

      .accordion-content {
        display: none;
        overflow: hidden;
        padding: 0px 0px;
        margin-bottom: 0px;
        text-align: center; /* Centre le contenu de l'accord√©on */
      }

      .icon-accordion {
        cursor: pointer;
        width: 45px;
        height: 45px;
        display: flex;
        align-items: center;
        padding: 15px;
      }

      .grid {
        width: 380px; /* Augmentez si n√©cessaire */
        margin: auto;
        padding-top: 20px;
      }

      /* Ajoutez cette classe pour espacer les boutons */
      .buttons-grid button {
          margin-bottom: 10px; /* Espacement de 10px entre les boutons */
      }

      .buttons-grid {
        display: grid;
        grid-template-columns: repeat(7, 1fr);
        gap: 5px 5px;
        margin-bottom: 0px;
        margin-top: 0px;

      }

      button {
        cursor: pointer;
        background-color: rgba(52, 53, 65, 0.5);
        color: #818181;
        padding: 5px; /* Ajoutez un padding pour √©loigner l'image de la bordure */
        border-radius: 10px;
        display: flex;
        border: 2px solid rgba(245, 245, 245, 0.3);
        transition: background-color 0.3s, border-color 0.3s; /* Ajoutez une transition pour le changement de couleur de la bordure */
        align-items: center;
        justify-content: center;
        position: relative;
        width: 35px;
        height: 35px;
        margin: auto;
      }

      button img {
        width: 20px; /* Taille plus petite par d√©faut */
        height: 20px;
        transition: width 0.3s, height 0.3s; /* Ajoutez une transition pour le changement de taille de l'image */
      }

      button:hover {
        background-color: rgba(52, 53, 65, 1);
        border-color: #5588ff; /* Changez la couleur de la bordure au survol */
      }

      button:hover img {
        width: 25px; /* Agrandissez l'image au survol */
        height: 25px;
      }

      #hover-text-container {
        position: fixed;
        top: 410px; /* Ajustez selon vos besoins */
        left: 50%;
        transform: translateX(-50%);
        background-color: rgba(0, 0, 0, 0); /* Fond transparent pour mieux voir la bordure du texte */
        color: #5588ff;
        padding: 10px;
        border-radius: 5px;
        font-family: "Orbitron", sans-serif; /* Utilisation de la police Orbitron */
        font-size: 36px;
        font-weight: bold; /* Texte en gras */
        opacity: 0;
        transition: opacity 0.3s;
        pointer-events: none; /* Pour que le conteneur n'interf√®re pas avec les interactions */
        display: flex; /* Permet de g√©rer l'alignement des √©l√©ments */
        justify-content: flex-end; /* Aligne les √©l√©ments √† la fin du conteneur */
        text-align: right; /* Aligne le texte √† droite */
        text-shadow:
          -1px -1px 0 #fff,
          1px -1px 0 #fff,
          -1px 1px 0 #fff,
          1px 1px 0 #fff; /* Bordure blanche autour du texte */
          letter-spacing: 4px; /* Espacement entre les caract√®res */
      }


      button .texte {
        display: none; /* Cache le texte original */
      }

      button:hover .texte {
        display: none; /* Garde le texte cach√© m√™me au survol */
      }

</style>

    <div class="fond"></div>
    <div class="container">
      <form id="search_form">
        <div id="hover-text-container"></div>
        <input id="neutral_search" list="neutralList" placeholder="Une id√©e,  une envie,  une question ?" type="text">
        <datalist id="neutralList"></datalist>

        <div class="accordion" id="accordion1">
          <div class="accordion-header" onclick="toggleAccordion('accordion1')">
            Op√©rateurs de recherche
          </div>
          <div class="accordion-content" id="content1">

            <input id="strict_search" list="mots" placeholder="Recherche stricte" type="text">
            <datalist id="mots"></datalist>

            <input id="exclude_search" list="excludes" placeholder="Exclure de la recherche" type="text">
            <datalist id="excludes"></datalist>

            <input id="site_search" list="sites" placeholder="Indiquer un domaine" type="text">
            <datalist id="sites">
              <option value="fr"></option>
              <option value="com"></option>
              <option value="net"></option>
              <option value="org"></option>
              <option value="io"></option>
              <option value="ai"></option>
              <option value="pro"></option>
              <option value="homes"></option>
              <option value="rocks"></option>
              <option value="fit"></option>
              <option value="ws"></option>
              <option value="sbs"></option>
              <option value="foo"></option>
              <option value="xtz"></option>
              <option value="you"></option>
              <option value="me"></option>
              <option value="stream"></option>
              <option value="tel"></option>
              <option value="tech"></option>
              <option value="top"></option>
              <option value="vip"></option>
              <option value="xyz"></option>
              <option value="zip"></option>
            </datalist>

            <input id="format_search" list="formats" placeholder="Recherche un type de fichier" type="text">
            <datalist id="formats">
              <option value="pdf"></option>
              <option value="txt"></option>
              <option value="jpg"></option>
              <option value="png"></option>
              <option value="gif"></option>
              <option value="doc"></option>
              <option value="xls"></option>
              <option value="ppt"></option>
            </datalist>

            <input id="time_search" list="times" placeholder="une p√©riode donn√©e" type="text">

      function buildQuery() {
        let neutral = document.getElementById("neutral_search").value;
        let strict = document.getElementById("strict_search").value;
        let exclude = document.getElementById("exclude_search").value;
        let site = document.getElementById("site_search").value;
        let format = document.getElementById("format_search").value;
        let time = document.getElementById("time_search").value;

        let query = neutral;

        if (strict) query += ` "${strict}"`;
        if (exclude) query += ` -${exclude}`;
        if (site) query += ` site:${site}`;
        if (format) query += ` filetype:${format}`;
        if (time) query += ` time:${time}`;

        return query;
      }
